import React, { useContext } from 'react';
import { useQuery } from '@tanstack/react-query';

const Profile = (props) => {
    const {data} = useQuery(['cat'], ()=>{
    fetch("https://catfact.ninja/fact")
    .then((res) => res.json())
    .then((data)=>{
        console.log(data)
      return data;
    })
    })
  return (
    <div>
      profile: username is {data}
    </div>
  )
}

export default Profile
